import { useState, useEffect } from 'react'

const ListResults = ({textToSearch}) => {

  const getData = async () => {
    const url = `http://localhost:3000/items?q=${textToSearch}`
    const data = await fetch(url)
      .then(res => res.json())
      .then(data => data)
      .catch(err => err)
      return data;
  }

  useEffect(() => {
    getData().then(data => console.log(data)).catch(err => console.log(err))
  }, [])
  

  return (
    <div>
      <h1>Lista de resultados</h1>
      <h1>{textToSearch}</h1>
    </div>
  )
}

export default ListResults
